import "./App.css";
import "./Project.css";


class Project extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="Project">
        <div className="title">
          <h1>
            project
          </h1>

          <div className="desc">
          <h2>
          this is the description yadda
          </h2>
          </div>

        </div>
      </div>
    );
  }
}

export default Project;
